import React from 'react'
import {useNavigate}  from 'react-router-dom'
function Home() {
    const navigate = useNavigate()
  return (
    <div>
        <p style={{'color':'white'}}>Home page</p>
        <button onClick={()=>{
            navigate('login')
        }}>login</button>
    </div>
  )
}

export default Home
